import Form from './components/Form';
import TodoItem from './components/TodoItem';
import './App.css';
import { Container, List } from '@mui/material';

function App() {
  return (
    <Container maxWidth="sm" className='container'>
      <Form />
      <List >
        <TodoItem />
      </List>
    </Container>
  );
}

export default App;
